import React from 'react';
import styled from "styled-components";

const CardEach = styled.div`
  display: flex;
  
`;



const Card = (props) => {
    return (
        <>
            <CardEach>
                <CardPicture></CardPicture>
                <CardContent></CardContent>



            </CardEach>
        
        
        
        </>
    );
};

export default Card;
